import React, {Component} from 'react';
import '../css/pages/product.css';

class Product extends Component {

    constructor(props){
        super(props);

    }

    render() {
        return (

            <div className="col-md-3 col-sm-6">
                <div className="product-grid">
                    <div className="product-image">
                        <a href="#">
                            <img className="pic-1" src={require("../assets/images/fish_masala5.jpg")} alt={''}/>
                            <img className="pic-2" src={require("../assets/images/fish_masala3.jpg")} alt={''}/>
                        </a>
                        <span className="product-discount-label">-25%</span>
                        <ul className="social">
                            <li><a href="" data-tip="Quick View"><i className="fa fa-search"/></a></li>
                            <li><a href="" data-tip="Add to Wishlist"><i
                                className="fa fa-shopping-bag"/></a>
                            </li>
                            <li><a href="" data-tip="Add to Cart"><i
                                className="fa fa-shopping-cart"/></a></li>
                        </ul>
                    </div>
                    <div className="product-content">
                        <h3 className="title">
                            <a href="#">Chicken Masala</a>
                        </h3>
                        <span className="product-category">
                                        <a href="#">Per pcs</a>
                                    </span>
                        <div className="price">Frw16.00
                            <span>Frw12.00</span>
                        </div>
                        <a className="add-to-cart" href="">ADD TO CART</a>
                    </div>
                </div>
            </div>

        );
    }
}

export default Product;
